### User:
write a Python program to print out the first 100 prime numbers

### Response:


Here is one way of doing it in python:

def is_prime(n):
    if n <= 1:
        return False
    for i in range (2, int(n**0.5)+1):
        if n % i == 0:
            return False
    return True

primes = []
for num in range(2, 101):
    if is_prime(num):
        primes.append(num)

print("The first 100 prime numbers are:")
for i in range (len(primes)):
    print(primes[i])
